import React, {useState,useEffect} from 'react';
import axios from 'axios'
import { Typography, Button, TextField, Paper } from '@material-ui/core';


function Customers() {

  const [data,setData] = useState([])

  useEffect(async()=>{
   await fetch('http://www.omdbapi.com/?s=Dexter&apikey=6496123e')
   .then((res)=>res.json()
   .then((data)=>setData(data)))
  })

  return(
    <div>
      <Typography 
      variant = "h2"
      align = "center"
      color = "primary"
      >
        Customers
      </Typography>
      <Button 
       variant = "contained"
       color = "secondary"
       onClick = {()=> {alert('clicked')}}
      >
       Click me
      </Button>

      <ul>
        {data.map(d=>
          <li>{d.Year}</li>)}
      </ul>
    </div>
  )
}
export default Customers;
